import React, { useState } from 'react';
import Login from './login';
import ZetamacGame from './ZetamacGame';

const App = () => {
  const [api, setApi] = useState(null);
  const [account, setAccount] = useState(null);

  const handleLogin = (apiInstance, accountInstance) => {
    setApi(apiInstance);
    setAccount(accountInstance);
  };

  return (
    <div className="App">
      {api && account ? (
        <ZetamacGame api={api} account={account} />
      ) : (
        <Login onLogin={handleLogin} />
      )}
    </div>
  );
};

export default App;
